To make sure the cat or kitten of your dreams does not slip through your fingers.
1) Fill out an adoption form &nbsp;2) Call RescueCats at 678-817-9647 or Jerri at 404-304&ndash;9210 to make sure the kitty is still available or e-mail rescuecats@hotmail.com or Jerri at JerriClay@gmail.com &nbsp;3) After receiving confirmation, a deposit of at least $50/cat or kitten plus a $3.00 PayPal fee is required and can be made online using PayPal. A link can be found at the bottom of the adoption form. 4. Don't have a PayPal account? You can either mail a money order to RescueCats, Inc PO Box 142882 Fayetteville Ga 30214, include the name(s) of the kitty/kitties. Another option is to bring the deposit in CASH to PETsMART in Morrow at the adoption fair every Saturday from 11AM to 4 PM. Please Note 1. All deposits are absolutely not refundable 2. Should the cat of your choice be no longer available, you will be given first choice of all available cats or wait and select among any new arrivals. 3. Priority is given to anyone willing to adopt more than one cat/kitten. Kittens, especially very small kittens, are much much happier when adopted with a sibling or buddy. 4. By the time most kittens are old enough to leave their foster homes, they have all been tested for FIV/FeLV, treated for worms, fleas and ear mites, spayed/neutered and immunized as appropriate for their age. All of which would cost well over $200 if paid directly to a vet.// Age and Size Guide: Baby: 0-6 months. Young: 6-24 months. Adult: 2-10 years. Senior: over 10 years. Small: 0-6 pounds. Medium: 7-12 pounds. Large: 13 - 25 pounds. Extra Large: over 25 pounds. If you don't see what you're looking for, please call and ask because we may have what you want. Adoption fees range from $110-$250.


&nbsp;
&nbsp;
This is what you get when you adopt a kitty from RescueCats:  A kitten or a cat that has been spayed or neutered, treated for fleas &amp; worms, microchipped, vaccinated for RCP &amp; Rabies(if old enough) &amp; tested negative for FeLV/FIV, and some older kitties have had dental cleanings.
